import html from "../images/img1.jpeg";
import css from "../images/img2.png";
import js from "../images/img3.jpg";
import react from "../images/img4.jpg";
import node from "../images/img5.png";
import php from "../images/img6.png";

const Sdata = [
    {
        img: html,
        title: "HTML Coding"
    }, {
        img: css,
        title: "CSS Coding"
    },
    {
        img: js,
        title: "Js Coding"
    }, {
        img: react,
        title: "REACT Coding"
    }, {
        img: node,
        title: "NODE Coding"
    }, {
        img: php,
        title: "PHP Coding"
    }
]
export default Sdata;
